import React, { Component } from 'react';
import { Link } from 'react-router-dom';

import SearchIcon from '@material-ui/icons/Search';
import MenuIcon from '@material-ui/icons/Menu';

import './TopNav.scss';

class TopNav extends Component {
  render() {
    return(
      <nav className="top-nav">
        <ul>
          <li>
            <Link to="#">Home</Link>
          </li>
          <li>
            <Link to="#">Site</Link>
          </li>
          <li>
            <Link to="#">Order</Link>
          </li>
          <li>
            <Link to="#">Game</Link>
          </li>
          <li>
            <Link to="#">
              <img className="top-nav-logo" src="https://www.khwiki.com/images/thumb/3/3a/Kingdom_Hearts_Series_Logo.png/350px-Kingdom_Hearts_Series_Logo.png" />
            </Link>
          </li>
          <li className="top-nav-date">
            <Link to="#">
              10 / 2
            </Link>
          </li>
          <li>
            <Link to="#" className="top-nav-icons spin circle">
              <div className="spinnerBackground">
                <SearchIcon style={{ color: '#000', marginBottom: '-.3rem' }}/>
              </div>
            </Link>
          </li>
          <li>
            <Link to="#" className="top-nav-icons spin circle">
              <div className="spinnerBackground">
                <MenuIcon style={{ color: '#000', marginBottom: '-.3rem' }}/>
              </div>
            </Link>
          </li>
        </ul>
      </nav>
    );
  }
}

export default TopNav;





